import React from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";


import '../new.css';

function ProjectCards(props) {
  return (
    
    <Card className="card"  >
      <Card.Img variant="top" src={props.imgPath} alt="card-img" />
      
      <Card.Body>

      
        
        <Card.Title className="rose" >{props.title}</Card.Title>
        

        <Card.Text  style={{ textAlign: "justify" }}>
       <strong style={{ fontSize: "1.3em" }}> Tools : <i class="fa-brands fa-react mx-3"></i>
        <i class="fa-brands fa-bootstrap"></i></strong>
        </Card.Text>
        <Button className="button" href={props.ghLink}>
        <i class="fa-brands fa-github"></i>
          Github
          
        </Button>

        {"\n"}
        {"\n"}
        
        <Button className="button" href={props.ghdemo}>
        <i class="fa-solid fa-desktop"></i>
          Demo
          
        </Button>
        
       
      </Card.Body>
    </Card>
   
  );
  
}
export default ProjectCards;
